<?php


namespace explore\strings;


class FirstUniqChar
{
    public function solution($s)
    {
        if (strlen($s) == 0 ) {return -1;}
        if (strlen($s) == 1) {return 0;}
        $arr = [];
        for ($i=0; $i<strlen($s); $i++) {
            $arr[$i] = $s[$i];
        }
        $countArr = [];
        foreach($arr as $item=>$value) {
            isset($countArr[$value]) ? $countArr[$value] += 1 : $countArr[$value] = 1;
        }

        $firstUnique = array_search('1', $countArr);
        return $firstUnique ? array_search($firstUnique, $arr) : -1;
    }

    public function solution_2($s)
    {
        if(!empty($s)){
            $s = strtolower($s);
            $sArray = str_split($s);
            $res = array_count_values($sArray);
            foreach ($res as $key => $val){
                if($val == 1){
                    return strpos($s, $key);
                }
            }
        }
        return -1;
    }
}

$reverse = new FirstUniqChar();
$tests = [
    'leetcode',         // 0
    'loveleetcode',     // 2
    "aadadaad",         // -1
    "dddccdbba",        // 8
    ""
];

foreach ($tests as $test) {
    $re = $reverse->solution($test);
    var_dump($re);
}